import './App.css';
import {Route, Routes} from "react-router-dom";
import Home from "./homePage";
import Login from "./loginPage";


function App() {
  return (
      <>
          <Routes>

              <Route path='/' element={<Home/>} />
              <Route path='/loginPage' element={<Login/>} />

          </Routes>
      </>


  );
}

export default App;
